utgoing communications for mailing, then sort and forwarded to Maam Rizalyn Domondon (RA 8749, RA 6969 and RA 9275). \r\n\r\nb.4 = Updated returned Registry Return Receipt coming from Postal Office to the Database of Mailed Documents, then sort and forwarded to Maam Rizalyn Domondon in charge of these Laws RA 6969, RA 8749, RA 9275 for safe keeping purposes. \r\n\r\nb.5 = Tracked incoming documents in the Document Tracking System and forwarded/delivered to concerned division.', '2020-05-14 15:58:25', '2020-05-15 03:34:52', NULL),
